servers : Array
[
{
    id : X , name : "test" , ip : "@ip" , status : "Active/Down"
}
]

*/

<template>
    <div class="table">
        <table>
            <tr class="table-header" >
                <td>Name</td>
                <td>IP</td>
                <td>Status</td>
            </tr>
            <tr  v-for="server in servers" :key="server.id" >
                <td class="server-name">{{ server.name }}</td>
                <td>
                    <p>{{ server.ip }}</p>
                </td>
                <td>
                    <p class="holder-status">
                        <span class="status-dot" ></span>
                        <span>Active</span>
                    </p>
                </td>
            </tr>



        </table>
    </div>
</template>
<script>
export default{
    name : "table-extension",
    data(){
        return{
            servers : [
                {
                    id : 5,
                    name : "Onboarding-uat",
                    ip : "192.168.1.104",
                    status : 'active'
                }
            ]
        }
    }
}
</script>
<style scoped>
.table table{
    width: 100%;
    background-color: var(--light-color-0);
    border-radius: var(--medieum-border-radius);

    border-collapse: collapse;


}
.table table  tr{
    height: 50px;

    box-sizing: border-box;
}
.table .server-name{
    font-weight: 500;
}
.table .table-header{
    color: var(--gray-text-color-1);
    font-weight: 500;
}
.holder-status{
    display: flex;
    justify-content: flex-start;
    align-items: center;
}
.status-dot{

    height: 8px;
    width: 8px;

    border-radius: 50%;

    background-color: gray;
}
.status-dot-down{
    background-color: var(--danger-color);
}
</style>
